package main

import (
	"sync"
	"testing"

	"github.com/clinta/dpass"
	"github.com/stretchr/testify/assert"
)

func TestConsistencyV1(t *testing.T) {
	assert := assert.New(t)
	wg := sync.WaitGroup{}
	for i, tp := range testParams {
		wg.Add(1)
		go func(tp testParam) {
			g, err := dpass.FromJSON([]byte(tp.json))
			assert.NoError(err)
			g.GenVersion = 1
			pw, err := dpass.GenPW(g, []byte(tp.mpw))
			assert.NoError(err)
			assert.Equal(testResultsV1[i], pw)
			wg.Done()
		}(tp)
	}
	wg.Wait()
}

